import React from 'react';

const NotFound = () => {
  return (
    <>
      <h1 className="x-large text-prymary">
        <i className="fas fa-exclamation-triangle"></i>
        Page Not Found
      </h1>
      <p className="large">Sorry, this page does not exist!</p>
    </>
  );
};

export default NotFound;
